    function BioScience_PlantDisease_Weibull_model(x_in) {
      var temp;
      temp = 0.0;

      // coefficients
      var a = -2.9039350989124828E+00;
      var b = 7.9846661459228132E+00;
      var c = 4.4780238831200248E-01;

      temp = 1.0 - Math.exp(-1.0 * Math.pow((x_in - a) / b, c));
      return temp;
    }


